import React from 'react'
import "../node_modules/bootstrap/dist/css/bootstrap.min.css";
const Contact = () => {
  return (
    <>
    <div className="my-5">
        <h1 className="text-center">Contact Us</h1>
    </div>  
    <div className="container contact_div">
        div.row
    </div>
    </>
  )
}

export default Contact
